-- ----------------------------
-- Table structure for album
-- ----------------------------
DROP TABLE IF EXISTS `album`;
CREATE TABLE `album` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `category_id` bigint(20) NOT NULL,
  `anchor` varchar(32) NOT NULL DEFAULT '' COMMENT '播者',
  `author` varchar(32) NOT NULL DEFAULT '' COMMENT '作者',
  `title` varchar(256) NOT NULL DEFAULT '',
  `title_image_url` varchar(512) NOT NULL DEFAULT '' COMMENT '标题图片地址',
  `cover_image_url` varchar(512) NOT NULL DEFAULT '' COMMENT '播放时大图地址',
  `summary` varchar(512) NOT NULL DEFAULT '' COMMENT '简介',
  `played_count` bigint(20) NOT NULL DEFAULT '0',
  `description` text COMMENT '描述',
  `subscription_count` bigint(20) NOT NULL DEFAULT '0' COMMENT '订阅数',
  `track_count` int(11) NOT NULL DEFAULT '0' COMMENT '包含单集数量',
  `nation` varchar(32) NOT NULL DEFAULT '' COMMENT '国家',
  `hot` bigint(20) NOT NULL DEFAULT '0' COMMENT '热度',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `free` tinyint(4) NOT NULL DEFAULT '0' COMMENT '免费标识',
  `finished` int(11) NOT NULL DEFAULT '1',
  `commentable` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否可评论',
  `rss_address` varchar(255) DEFAULT NULL COMMENT 'rss地址',
  `removed` tinyint(2) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4214 DEFAULT CHARSET=utf8;

