DROP TABLE IF EXISTS `track`;
CREATE TABLE `track` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `album_id` bigint(20) NOT NULL,
  `title` varchar(256) NOT NULL DEFAULT '' COMMENT '标题',
  `summary` text,
  `description` text,
  `title_image_url` varchar(512) NOT NULL DEFAULT '' COMMENT '标题图片地址',
  `image_url` varchar(512) NOT NULL DEFAULT '' COMMENT '图片地址',
  `media_url` varchar(256) NOT NULL DEFAULT '' COMMENT '播放链接',
  `duration` bigint(20) NOT NULL DEFAULT '0' COMMENT '时长(保留字段)',
  `free` tinyint(4) NOT NULL DEFAULT '1' COMMENT '收费标识',
  `public` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否可以公开给第三方',
  `played_count` bigint(20) NOT NULL DEFAULT '0' COMMENT '播放次数',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `release_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '发布时间',
  `commentable` tinyint(4) NOT NULL DEFAULT '1',
  `removed` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1004 DEFAULT CHARSET=utf8;

