DROP TRIGGER IF EXISTS `trigger_track_count_of_album`;
DELIMITER ;;
CREATE TRIGGER `trigger_track_count_of_album` AFTER INSERT ON `track` FOR EACH ROW BEGIN
update album set track_count= track_count+1 where id =new.album_id;
END
;;
DELIMITER ;
